Isahluko 1: Iziseko (1-6) 1. IRiphablikhi yoMzantsi-Afrika - IRiphablikhi yoMzantsi-Afrika ililizwe elinye, elizimeleyo, lentando yesininzi elisekelwe koku kulandelayo: - sokuba ngumntu, ukufikelela ekulinganeni kwabantu bonke nokukhuthazwa kwamalungelo oluntu neenkululeko omalube nazo; - ukungacaluli ngokobuhlanga nangokobuni; - ukongama koMgaqo-siseko nokulawula komthetho; - ilungelo lokuvota kwabo bonke abantu abadala, umqulu wabavoti omnye wezwelonke, unyulo olubakho rhoqo nenkqubo yamaqela 
..........
ali yazo yokuncitshiswa kokusetyenziswa kwazo, urhulumente makathabathe amanyathelo asebenzisekayo naqinisekileyo okuphakamisa umgangatho wezi lwimi aze akhuthaze ukusetyenziswa kwazo. - - Urhulumente wezwelonke noorhulumente bamaphondo banokusebenzisa naziphi na iilwimi zaseburhulumenteni, bezisebenzisela imisebenzi yoburhulumente, becingela ukusetyenziswa kwazo, ukusebenziseka kwazo, indleko yokuzisebenzisa, iimeko zengingqi neemfuno zoluntu noko kukhethwa luluntu lulonke okanye kwiphondo elo;

Mateyu 25 “Ngoko ubukumkani bamazulu buya kuba njengeentombi ezinyulu ezilishumi ezathabatha izibane+ zazo, zaphuma zaya kuhlangabeza umyeni.+ 2 Ezintlanu zazo zazizizidenge,+ kwaye ezintlanu ziziingqondi.+ 3 Ezizizidenge zathabatha izibane zazo kodwa azizange ziyithabathe ioli, 4 kanti eziziingqondi zathabatha ioli ngezikhongozelo zazo nezibane zazo. 5 Ngoxa umyeni wayelibele, zanqwaleka zonke zaza zalala.+ 6 Kanye phakathi kobusuku kwavela udanduluko,+ ‘Nanku umyeni! Phumani niye kumhlangabeza
..........
ku okukokwakho.’ 26 Ekuphenduleni inkosi yalo yathi kulo, ‘Khobokandini elingendawo nelidangeleyo, ubusazi, andibi kunjalo, ukuba ndavuna apho ndandingahlwayelanga khona yaye ndahlanganisa apho ndandingelanga khona? 27 Ngoko ke, ubufanele ukuba ubeke imali yam yesilivere koonobhanki, ndize ekufikeni kwam ndamkele oko kukokwam nenzala.+ 28 “‘Ngoko ke yithabatheni italente kuye nize niyinike lowo uneetalente ezilishumi.+ 29 Kuba wonk’ ubani onako, uya kunikwa okungakumbi yaye uya kuba nentabalala;
